import React from "react";
import { Avatar } from "@mui/material";

function Profile() {
  return (
    <div className="profile">
      <Avatar
        className="profile__avatar"
        src="https://fameimpact.com/wp-content/uploads/2021/09/Hasbulla-Magomedov-6.jpg"
        alt="Sahd Khan"
      />
    </div>
  );
}

export default Profile;
